import logo from './logo.svg';
import './App.css';
import SavedWords from "./components/WordList"
import RhymeButton from "./components/RhymeButton"
import SynonymsButton from "./components/SynonymsButton"


function App() {

    return(
    <main className="container">
        <h1 className="row">Rhyme Finder 579 (Problem Set 6)</h1>
        <h2>Github link: <a href="#">#</a> </h2>

        <div className="row">
            <SavedWords savedWords={savedWords}/>
        </div>
        <div className="row">
            <div className="input-group col">
                <input className="form-control" type="text" placeholder="Enter a word"
                       onChange={(e)=>{
                           setInputWords(e.target.value);
                       }}

                       onKeyDown={(e) => {
                           if (e.key==="Enter"){
                               datamuseRequest(getDatamuseRhymeUrl(inputWords),rhyme);
                           }}}
                />
                <RhymeButton
                    inputWords={inputWords}
                    rhyme={rhyme}
                    datamuseRequest={datamuseRequest}
                    getDatamuseRhymeUrl={getDatamuseRhymeUrl}
                />
                <SynonymsButton
                    inputWords={inputWords}
                    datamuseRequest={datamuseRequest}
                    generateWords={generateWords}
                    setOutputWord={setOutputWord}
                />
            </div>
        </div>
        <div className="row">
            <h2 className="col"></h2>
        </div>
        <div className="output row">
            <output className="col">{outputWord}</output>
        </div>

    </main>
);
}


export default App;
